	render_object* find_object_at(int x, int y)
	{
		int i;
		render_object* object = NULL;

		for (i = 0; i < render_objects.size(); i++)
		{
			if (render_objects[i].x == x && render_objects[i].y == y)
			{
				object = &render_objects[i];
			}
		}

		return object;
	}

	void switch_objects(render_object* obj1, render_object* obj2)
	{
		int x_temp;
		int y_temp;

		x_temp = obj1->x;
		y_temp = obj1->y;

		obj1->x = obj2->x;
		obj1->y = obj2->y;

		obj2->x = x_temp;
		obj2->y = y_temp;
	}

	std::string setcolor(std::string color_name)
	{
		// http://web.theurbanpenguin.com/adding-color-to-your-output-from-c/
		std::string escape = "\033";
		std::map<std::string, std::string> colors = {
			{"red", "[0;31m"},
			{"bold red", "[1;31m"},
			{"green", "[0;32m"},
			{"bold green", "[1;32m"},
			{"yellow", "[0;33m"},
			{"bold yellow", "[01;33m"},
			{"blue", "[0;34m"},
			{"bold blue", "[1;34m"},
			{"magenta", "[0;35m"},
			{"bold magenta", "[1;35m"},
			{"cyan", "[0;36m"},
			{"bold cyan", "[1;36m"},
			{"reset", "[0m"}
		};

		return escape + colors[color_name];
	}

	std::map<std::array<int, 2>, render_object> sort_objects()
	{
		int i;
		std::array<int, 2> index_store;
		std::map<std::array<int, 2>, render_object> objects;

		for (i = 0; i < render_objects.size(); i++)
		{
			index_store = {render_objects[i].x, render_objects[i].y};
			objects[index_store] = render_objects[i];
		}

		return objects;
	}

